import classes from "./../../css/Dialogs.module.css";
import { NavLink } from 'react-router-dom';

const Contact = (props) => {
	let path = "/dialogs/" + props.id;
	
	return (
		<NavLink to={path}><li>{props.name}</li></NavLink>
	);
}

const Contacts = (props) => {

	let ContactArr = [
		{ id: 0, name: "Даун Иваныч"},
		{ id: 1, name: "Лох Иваныч" }
	];

	return (
		<div>
			<h2>Контакты</h2>
			<div>
				<ul>
					<Contact name="Даун Иваныч" id="1"/>
					<Contact name="Лох Иваныч" id="2" />
					<Contact name="Чмо Иваныч" id="3" />
					<Contact name="Пидор Иваныч" id="4" />
					<Contact name="Хуй Иваныч" id="5" />
				</ul>
			</div>
		</div>
	);
}

export default Contacts;
